import axios from "axios";

export const signUpUser = (username, email, password, roles) => {
  //   axios
  //     .post("http://localhost:8080/api/auth/signup", {
  //       username: username,
  //       email: email,
  //       password: password,
  //       roles: roles,
  //     })
  //     .then((response) => {
  //       console.log(response);
  //     })
  //     .catch((error) => {
  //       console.log(error);
  //     });
  const data = {
    username: username,
    email: email,
    password: password,
    roles: roles,
  };
  fetch(`http://localhost:8080/api/auth/signup`, {
    method: "POST", // or 'PUT'
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify(data),
  })
    .then((response) => response.json())
    .then((data) => {
      console.log("Success:", data);
    })
    .catch((error) => {
      console.error("Error:", error);
    });
};
